import React, { useState, useCallback } from "react";
import ReactFlow, {
  Controls,
  MiniMap,
  Background,
  addEdge,
  useNodesState,
  useEdgesState,
} from "@xyflow/react";
import "@xyflow/react/dist/style.css";

const initialNodes = [
  { id: "1", type: "rectangle", position: { x: 100, y: 100 }, data: { label: "Rectangle" } },
  { id: "2", type: "circle", position: { x: 300, y: 100 }, data: { label: "Circle" } },
];

const initialEdges = [];

const CustomNode = ({ data }) => (
  <div
    style={{
      padding: "10px",
      borderRadius: "5px",
      background: "#fff",
      border: "2px solid #333",
      textAlign: "center",
      minWidth: "100px",
    }}
  >
    {data.label}
  </div>
);

const nodeTypes = {
  rectangle: CustomNode,
  circle: CustomNode,
  ellipse: CustomNode,
  triangle: CustomNode,
  pentagon: CustomNode,
  hexagon: CustomNode,
  star: CustomNode,
  parallelogram: CustomNode,
  diamond: CustomNode,
  arrow: CustomNode,
};

export default function Editor() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);

  const onConnect = useCallback(
    (params) => setEdges((eds) => addEdge(params, eds)),
    [setEdges]
  );

  const addShape = (type) => {
    const newNode = {
      id: `${nodes.length + 1}`,
      type,
      position: { x: Math.random() * 400, y: Math.random() * 300 },
      data: { label: type.charAt(0).toUpperCase() + type.slice(1) },
    };
    setNodes((nds) => [...nds, newNode]);
  };

  return (
    <div style={{ height: "100vh", width: "100%" }}>
      <div style={{ position: "absolute", zIndex: 10, top: 10, left: 10 }}>
        {Object.keys(nodeTypes).map((shape) => (
          <button key={shape} onClick={() => addShape(shape)} style={{ marginRight: 5 }}>
            {shape}
          </button>
        ))}
        <button
          onClick={() => console.log("Save/Export Feature")}
          style={{ marginRight: 5 }}
        >
          Export
        </button>
      </div>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        nodeTypes={nodeTypes}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
        fitView
      >
        <MiniMap />
        <Controls />
        <Background color="#aaa" gap={16} />
      </ReactFlow>
    </div>
  );
}
